import React from 'react'
import './FirstSectionForMainPage.scss'
import LineForMainTitle from "../../../../Components/LineForMainTitleAllPages/LineForMainTitle";

export const FirstSectionForMainPage = () => {
    return (
        <div className="articleWrapper">
            <div className="LeftSide">
                <h1 className="FirstArticle">Адресник</h1>
                <LineForMainTitle/>
                <h2 className="SecondArticle">это универсальный жетон, содержащий краткую информацию, которая способна
                    помочь вернуть потерявшееся животное домой. Имя питомца и телефон для связи являются обязательными
                    данными, которые гравируются на медальоне.</h2>
            </div>
            {/*<div className="RightSide">*/}
            {/*    <button className="CreateDesign" title="123"/>*/}
            {/*</div>*/}
        </div>
    )
}

export default FirstSectionForMainPage;
